import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class ClienteService {

  constructor(private http:HttpClient) { }

  path = 'http://localhost:8080/Cajero/Precio';

  public IngresarCliente(nombre:String,apellidos:String,telefono:String,nit:String){
    let cliente:Cliente = new Cliente(nombre,apellidos,telefono,nit);
    this.http.post(this.path,cliente);
  }

}

class Cliente{
  private Nombre:String;
  private Apellidos:String;
  private Telefono:String;
  private Nit:String;

  constructor(Nombre:String,Apellidos:String,Telefono:String,Nit:String){
    this.Nombre = Nombre;
    this.Apellidos = Apellidos;
    this.Telefono = Telefono;
    this.Nit = Nit;
  }

  public getNombre():String{
    return this.Nombre;
  }


  public getApellido():String{
    return this.Apellidos;
  }

  public getTelefono():String{
    return this.Telefono;
  }

  public getNit():String{
    return this.Nit;
  }



}
